import React, { useState } from 'react'
import styled from "styled-components";

const Login = () => {

  const [state, setState] = useState(true)

  return (
    <LoginStyle>
      <button>빨간 버튼</button>
      <button>파란 버튼</button>
      {state ? 
      <div>빨간 버튼이 활성화 됐습니다.</div> :
      <div>파란 버튼이 활성화 됐습니다.</div>}
    </LoginStyle>
  )
}

export default Login

const LoginStyle = styled.div`
  height: 50vh;
  display: flex;
  justify-content: center;
  align-items: center;

  button{
    width: 150px;
    height: 50px;
    margin: 0 30px;
  }

  div{
    width: 50vw;
    height: 30vh;
    background-color: red;
  }
`
